import React from "react";
import {Box,Button,Select,Typography,MenuItem} from '@material-ui/core'

export default props =>{
    return(
        <Box>
            <Select>
                <MenuItem>Full-Time</MenuItem>
                <MenuItem>Part-Time</MenuItem>
                <MenuItem>Contract</MenuItem>

            </Select>
        </Box>
    )
}
